import projImg4 from "../assets/img/project-img4.png";
import projImg5 from "../assets/img/project-img5.png";
import colorSharp2 from "../assets/img/color-sharp2.png";
import 'animate.css';
import TrackVisibility from 'react-on-screen';

export const Projects = () => {

  const projects = [
    {
      title: "Drum Kit",
      description: "Made using HTML,CSS,JAVASCRIPT",
      imgUrl: projImg1,
    },
    {
      title: "Portfolio",
      description: "React js project",
      imgUrl: projImg2,
    },
    {
      title: "Simon Game",
      description: "Web Game",
      imgUrl: projImg3,
    },
    {
      title: "ToDo List",
      description: "Made using HTML,CSS,NodeJs,MongoDb ",
      imgUrl: projImg4,
    },
    {
      title: "Tindog",
      description: "Made using HTML,CSS,Bootstrap",
      imgUrl: projImg5,
    },
    
  ];

  return (
    <section className="project" id="projects">
      <Container>
        <Row>
          <Col size={12}>
            <TrackVisibility>
              {({ isVisible }) =>
              <div className={isVisible ? "animate__animated animate__fadeIn": ""}>
                <h2>Projects</h2>
                <p>Building projects allows you to apply theoretical concepts and skills you've learned in a real-world context. It's a practical way to solidify your understanding of programming languages, algorithms, data structures, and other computer science fundamentals.</p>
